import { createPortal } from "react-dom"

const Modal = ({ isOpened, children, onClose }) => {
  if (!isOpened) {
    return null;
  }
  return createPortal(
    <div>
      Portal :
    </div>, 
    document.getElementById("portal")
  )
}

export default Portal
